import React from 'react';
import './App.css';

function Main() {
return (
    <nav>
        <h3>Logo</h3>
        <ul>
            <li>Apple</li>
            <li>Orange</li>
            <li>Banana</li>
        </ul>
    </nav>
);

}

export default Main;
